// Extrae el nombre del archivo. Si no viene, usa un nombre genérico según el tipo.
const fileName = $json.body.fileName || 
  ($json.body.mimetype?.includes('image') ? 'imagen.jpg' : 'archivo.pdf');

// Extrae los datos en base64.
const dataBase64 = $json.body.data;
if (!dataBase64) {
  throw new Error("No se recibió 'data' en base64.");
}

// Determina el MIME Type. WhatsApp puede enviar:
// - Para imágenes: 'image/jpeg', 'image/png', etc.
// - Para PDFs: 'application/pdf'
const mimeType = $json.body.mimetype || 
  (fileName.endsWith('.pdf') ? 'application/pdf' : 'image/jpeg');

// Convierte a buffer binario.
const buffer = Buffer.from(dataBase64, 'base64');

// Prepara el objeto para OCR Space.
// Importante: OCR Space requiere 'base64Image' para imágenes y 'file' para PDFs.
const ocrPayload = {
  binary: {
    data: {
      data: buffer,
      mimeType,
      fileName
    }
  },
  json: {
    ...$json,
    // Añade parámetros específicos para OCR Space:
    engine: 1,               // Motor de OCR (1 = gratuito con límite).
    language: 'spa',         // Idioma (español).
    isOverlayRequired: false // Si necesitas texto con coordenadas.
  }
};

// Si es una imagen, envía como 'base64Image'. Si es PDF, como 'file'.
if (mimeType.includes('image')) {
  ocrPayload.json.base64Image = dataBase64;
} else {
  ocrPayload.json.file = {
    value: buffer,
    options: {
      filename: fileName,
      contentType: mimeType
    }
  };
}

return ocrPayload;

// Suponiendo que la respuesta viene en $json.choices[0].message.content
let content = $json.choices?.[0]?.message?.content || $json.content || '';

// Borra cualquier texto antes o después del JSON real
let match = content.match(/\{[\s\S]*\}/);
let data = {};
try {
  data = match ? JSON.parse(match[0]) : {};
} catch (e) {
  data = {};
}

// Usá la fecha que venga (ISO), o ahora mismo
let fechaOriginal = $json.fecha || new Date().toISOString();
let fechaObj = new Date(fechaOriginal);

// ⚠️ Ajuste horario Argentina: restá 3 horas (en milisegundos)
fechaObj = new Date(fechaObj.getTime() - 3 * 60 * 60 * 1000);

function pad(n) { return n < 10 ? '0' + n : n; }

const fecha_formateada = 
  pad(fechaObj.getDate()) + '/' + 
  pad(fechaObj.getMonth() + 1) + '/' + 
  fechaObj.getFullYear() + ' ' + 
  pad(fechaObj.getHours()) + ':' + 
  pad(fechaObj.getMinutes());

return {
  json: {
    ...$json,
    ...data,
    fecha_formateada
  }
};

// El input puede venir con los campos adentro de 'body'
const from = $json.body?.from || "";
const textoCompleto = $json.body?.textoCompleto || "";

// Limpiás el número de WhatsApp (sacás el "@c.us" si está)
const numero = from.replace(/@c\.us$/, "");

// Generás el link con punto y coma para Google Sheets (o con coma si tu Sheets está en inglés)
const whatsapp_link = `=HYPERLINK("https://wa.me/${numero}"; "${numero}")`;

return {
  json: {
    whatsapp: whatsapp_link,
    textoCompleto
  }
};

// Si whatsapp y textoCompleto ya están en $json, solo usalos así:
const whatsapp = $json.whatsapp || "";
const textoCompleto = $json.textoCompleto || "";

// OpenAI
const entradaAI = $json.message || {};
const fechaFormateadaInput = $json.fecha_formateada || "";

// Extrae el JSON de OpenAI
let data = {};
if (typeof entradaAI.content === 'string') {
  try {
    let match = entradaAI.content.match(/\{[\s\S]*\}/);
    data = match ? JSON.parse(match[0]) : {};
  } catch (e) {
    data = {};
  }
}

// Obtiene la fecha del depósito
const fecha_deposito = data.fecha || "";

// Usa la fecha formateada ya calculada, o la crea si no está
let fecha_formateada = fechaFormateadaInput;
if (!fecha_formateada) {
  const fechaOriginal = fecha_deposito || new Date().toISOString();
  const fechaObj = new Date(fechaOriginal);
  function pad(n) { return n < 10 ? '0' + n : n; }
  fecha_formateada =
    pad(fechaObj.getDate()) + '/' +
    pad(fechaObj.getMonth() + 1) + '/' +
    fechaObj.getFullYear() + ' ' +
    pad(fechaObj.getHours()) + ':' +
    pad(fechaObj.getMinutes());
}

return {
  json: {
    whatsapp,
    textoCompleto,
    fecha_deposito,      // ← Esta es la fecha cruda del JSON IA
    ...data,
    fecha_formateada,
  }
};
